import React from 'react'
import styled from 'styled-components'

import { ReactComponent as Tab } from '../../src/assets/svg/navigator.svg'

export const ContainerTab = styled.span`
  z-index: 9999;
  position: fixed;
  bottom: 0;
  display: flex;
  align-items: center;
  width: 100%;
`

export const TabBar = styled(Tab)`
  width: 100%;
`
